Special program for converting of your computer into a television set and radio receiver. CHRISTV Online! allows to look over the enormous amount of TV-channels, wireless stations and other audio-video material, translated through a network the Internet. For everything it is utillized only connection with the Internet, and it is needed no additional equipment. In the base of the program CHRISTV Online! there are more than 800 televisional channels and more than 600 wireless stations from 100 countries of the world, the list of which brushes up daily.

The choice of channels can be made after a figure, to the type, category, language, name of the station. Favourite tele- and wireless stations it is possible to add to the list favourite channels which will be shown separately in a general list.
